import React from 'react';
import { useSelector } from 'react-redux';

const TodoItem = () => {
    const data = useSelector((state)=>state.todo.value);
    console.log(data);
    return(
        <div>
            {
                data
            }
        </div>
    )
}

export default TodoItem;
